contracts/Asami.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.19;
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Capped.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract Asami is ERC20Capped, ReentrancyGuard {
    enum Site {
        X,
        Instagram,
        LinkedIn,
        Facebook,
        TikTok,
        Youtube,
        Nostr,
        Bluesky,
        Reserved1,
        Reserved2,
        Reserved3,
        Reserved4,
        Reserved5,
        Reserved6
    }

    struct Account {
        uint256 id;
        address addr;
        uint256 unclaimedAsamiTokens;
        uint256 unclaimedDocRewards;
        uint256[] handles;
        uint256[] campaigns;
        uint256[] collabs;
    }
    uint256[] public accountIds;
    mapping(uint256 => Account) public accounts;
    mapping(address => uint256) public accountIdByAddress;
    event AccountSaved(Account account);

    struct Handle {
        uint256 id;
        uint256 accountId;
        Site site;
        uint256 price;
        uint256 score;
        uint256[] topics;
        string username;
        string userId;
        bool needsUpdate;
        string newUsername;
        uint256 newPrice;
        uint256 newScore;
        uint256[] newTopics;
        uint256 lastUpdated;
    }
    Handle[] public handles;
    event HandleSaved(Handle handle);

    function getHandles() public view returns (Handle[] memory) {
        return handles;
    }

    struct Campaign {
        uint256 id;
        uint256 accountId;
        Site site;
        uint256 budget;
        uint256 remaining;
        string contentId;
        uint256 priceScoreRatio;
        uint256[] topics;
        uint256 validUntil;
        bool fundedByAdmin;
    }
    Campaign[] public campaigns;
    event CampaignSaved(Campaign campaign);
    function getCampaigns() public view returns (Campaign[] memory) {
        return campaigns;
    }

    struct Collab {
        uint256 id;
        uint256 handleId;
        uint256 campaignId;
        uint256 gross;
        uint256 fee;
        string proof;
        uint256 createdAt;
    }
    Collab[] public collabs;
    event CollabSaved(Collab collab);

    uint256 public defaultFeeRate = 10 * 1e18;
    uint256 public feeRate = defaultFeeRate;
    uint256 public votedFeeRate = defaultFeeRate;
    uint256 public votedFeeRateVoteCount = 0;
    /* To make the protocol more predictable, changes are applied only once every period */
    uint256 public lastVotedFeeRateAppliedOn = 0;

    struct FeeRateVote {
        uint256 votes;
        uint256 rate;
    }
    mapping(address => FeeRateVote) public feeRateVotes;

    struct AdminVote {
        uint256 votes;
        address candidate;
        uint256 cycle;
        bool vested;
    }
    /* Maps holders to their vote */
    mapping(address => AdminVote) public submittedAdminVotes;
    event AdminVoteSaved(AdminVote vote);

    struct AdminVoteCount {
        uint256 votes;
        address candidate;
    }

    /*
    We're only storing all historic vote counts to have a view function that helps find out
    which candidate to proclaim without relying on events.
    */
    AdminVoteCount[] public adminVoteCounts;
    mapping(address => uint256) public adminVoteCountIdByCandidate;

    function allAdminVoteCounts()
        public
        view
        returns (AdminVoteCount[] memory)
    {
        return adminVoteCounts;
    }

    uint256 public vestedAdminVotesTotal;
    uint256 public lastAdminElection;
    address[3] public latestAdminElections;

    function getLatestAdminElections() public view returns (address[3] memory) {
        return latestAdminElections;
    }

    string[] public topics;
    event TopicSaved(uint256 id, string name);

    IERC20 internal doc;
    address[] public holders;
    mapping(address => bool) public trackedHolders;

    address public admin; // An address that may be stored on a server.
    address public adminTreasury; // A cold storage address for admin money.

    uint256 public claimedAsamiTokens;

    modifier onlyAdmin() {
        require(msg.sender == admin || msg.sender == adminTreasury);
        _;
    }

    constructor(
        address _dollarOnChainAddress,
        address _adminAddress
    ) ERC20("AsamiToken", "ASAMI") ERC20Capped(21 * 1e24) {
        doc = IERC20(_dollarOnChainAddress);
        adminTreasury = msg.sender;
        admin = _adminAddress;
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        super._beforeTokenTransfer(from, to, amount);

        if (from != address(0)) {
            _registerRecentBalanceChange(from, amount, false);

            if (feeRateVotes[from].votes > 0) {
                removeFeeRateVoteHelper(from);
            }
            if (submittedAdminVotes[from].votes > 0) {
                removeAdminVoteHelper(from);
            }
        }

        if (to != address(0)) {
            _registerRecentBalanceChange(to, amount, true);

            if (!trackedHolders[to] && amount > 0) {
                holders.push(to);
                trackedHolders[to] = true;
            }
        }
    }

    function getHolders() public view returns (address[] memory) {
        return holders;
    }

    function getClaimedAsamiTokens() public view returns (uint256) {
        return claimedAsamiTokens;
    }

    function getTopics() public view returns (string[] memory) {
        return topics;
    }

    function adminAddTopics(string[] calldata _names) public onlyAdmin {
        for (uint256 i = 0; i < _names.length; i++) {
            topics.push(_names[i]);
            emit TopicSaved(topics.length, _names[i]);
        }
    }

    function ensureAccount(uint256 _accountId) private {
        if (accounts[_accountId].id == 0) {
            accounts[_accountId].id = _accountId;
            accountIds.push(_accountId);
        }
    }

    struct AdminClaimAccountsInput {
        uint256 accountId;
        address addr;
    }

    function claimAccounts(
        AdminClaimAccountsInput[] calldata _input
    ) external onlyAdmin nonReentrant {
        for (uint256 i = 0; i < _input.length; i++) {
            AdminClaimAccountsInput calldata claim = _input[i];
            ensureAccount(claim.accountId);

            Account storage account = accounts[claim.accountId];
            require(account.addr == address(0));

            accountIdByAddress[claim.addr] = claim.accountId;
            account.addr = claim.addr;

            if (account.unclaimedAsamiTokens > 0) {
                uint256 unclaimed = account.unclaimedAsamiTokens;
                account.unclaimedAsamiTokens = 0;
                _safeMint(claim.addr, unclaimed);
            }

            if (account.unclaimedDocRewards > 0) {
                uint256 unclaimed = account.unclaimedDocRewards;
                account.unclaimedDocRewards = 0;
                doc.transfer(account.addr, unclaimed);
            }

            emit AccountSaved(account);
        }
    }

    function adminMakeHandles(Handle[] calldata _inputs) external onlyAdmin {
        for (uint256 i = 0; i < _inputs.length; i++) {
            ensureAccount(_inputs[i].accountId);

            handles.push(_inputs[i]);
            Handle storage h = handles[handles.length - 1];
            h.id = handles.length;
            emit HandleSaved(h);
        }
    }

    struct CampaignInput {
        Site site;
        uint256 budget;
        string contentId;
        uint256 priceScoreRatio;
        uint256[] topics;
        uint256 validUntil;
    }
    function makeCampaigns(
        CampaignInput[] calldata _inputs
    ) public nonReentrant {
        Account storage account = accounts[accountIdByAddress[msg.sender]];
        require(account.addr != address(0), "mc 0");

        for (uint i = 0; i < _inputs.length; i++) {
            CampaignInput memory input = _inputs[i];
            _saveCampaignHelper(
                account,
                Campaign({
                    id: campaigns.length + 1,
                    accountId: account.id,
                    site: input.site,
                    budget: input.budget,
                    remaining: input.budget,
                    contentId: input.contentId,
                    priceScoreRatio: input.priceScoreRatio,
                    topics: input.topics,
                    validUntil: input.validUntil,
                    fundedByAdmin: false
                })
            );
        }
    }

    struct AdminCampaignInput {
        uint256 accountId;
        CampaignInput attrs;
    }

    function adminMakeCampaigns(
        AdminCampaignInput[] calldata _inputs
    ) public onlyAdmin nonReentrant {
        for (uint i = 0; i < _inputs.length; i++) {
            AdminCampaignInput memory input = _inputs[i];
            ensureAccount(input.accountId);
            Account storage account = accounts[input.accountId];
            require(account.addr == address(0));

            _saveCampaignHelper(
                account,
                Campaign({
                    id: campaigns.length + 1,
                    accountId: account.id,
                    site: input.attrs.site,
                    budget: input.attrs.budget,
                    remaining: input.attrs.budget,
                    contentId: input.attrs.contentId,
                    priceScoreRatio: input.attrs.priceScoreRatio,
                    topics: input.attrs.topics,
                    validUntil: input.attrs.validUntil,
                    fundedByAdmin: true
                })
            );
        }
    }

    function _saveCampaignHelper(
        Account storage _account,
        Campaign memory _campaign
    ) private {
        require(_campaign.budget > 0);
        require(bytes(_campaign.contentId).length > 0);
        require(doc.transferFrom(msg.sender, address(this), _campaign.budget));

        campaigns.push(_campaign);
        _account.campaigns.push(_campaign.id);
        emit CampaignSaved(_campaign);
    }

    struct AdminMakeCollabsInput {
        uint256 campaignId;
        uint256 handleId;
    }

    function adminMakeCollabs(
        AdminMakeCollabsInput[] calldata _collabs
    ) external onlyAdmin nonReentrant {
        for (uint256 i = 0; i < _collabs.length; i++) {
            Handle storage handle = handles[_collabs[i].handleId - 1];
            require(handle.id > 0, "amc1");
            Account storage member = accounts[handle.accountId];

            Campaign storage campaign = campaigns[_collabs[i].campaignId - 1];
            require(campaign.id > 0, "amc2");
            require(campaign.validUntil > block.timestamp, "amc3");
            require(isSubset(handle.topics, campaign.topics), "amc4");

            require(campaign.remaining >= handle.price, "amc5");
            require(campaign.site == handle.site, "amc6");
            require(
                (handle.price / handle.score) <= campaign.priceScoreRatio,
                "amc7"
            );

            Account storage advertiser = accounts[campaign.accountId];

            uint256 gross = handle.price;
            uint256 fee = (gross * feeRate) / 1e20;
            uint256 reward = gross - fee;

            Collab memory collab = Collab({
                id: collabs.length + 1,
                handleId: handle.id,
                campaignId: campaign.id,
                gross: gross,
                fee: fee,
                proof: "",
                createdAt: block.timestamp
            });
            collabs.push(collab);
            member.collabs.push(collab.id);

            campaign.remaining -= gross;
            changeFeePool(fee, true);

            uint256 remainingToCap = cap() - claimedAsamiTokens;
            uint256 newTokens = (fee > remainingToCap) ? remainingToCap : fee;
            claimedAsamiTokens += newTokens;

            uint256 advertiserTokens = (newTokens * 10 * 1e18) / 100e18;
            uint256 memberTokens = (newTokens * 15 * 1e18) / 100e18;
            uint256 adminTokens = newTokens - advertiserTokens - memberTokens;

            if (adminTokens > 0) {
                _safeMint(adminTreasury, adminTokens);
            }

            if (member.addr == address(0)) {
                if (memberTokens > 0) {
                    member.unclaimedAsamiTokens += memberTokens;
                }
                member.unclaimedDocRewards += reward;
                emit AccountSaved(member);
            } else {
                if (memberTokens > 0) {
                    _safeMint(member.addr, memberTokens);
                }
                doc.transfer(member.addr, reward);
            }

            if (advertiserTokens > 0) {
                if (advertiser.addr == address(0)) {
                    advertiser.unclaimedAsamiTokens += advertiserTokens;
                    emit AccountSaved(advertiser);
                } else {
                    _safeMint(advertiser.addr, advertiserTokens);
                }
            }

            emit CollabSaved(collab);
            emit CampaignSaved(campaign);
        }
    }

    function reimburseDueCampaigns(
        uint256[] calldata _campaignIds
    ) external nonReentrant {
        for (uint i = 0; i < _campaignIds.length; i++) {
            Campaign storage campaign = campaigns[_campaignIds[i] - 1];
            require(campaign.id > 0, "rdc 0");
            require(campaign.remaining > 0, "rdc 1");
            require(campaign.validUntil < block.timestamp, "rdc 2");

            Account storage advertiser = accounts[campaign.accountId];
            uint256 remaining = campaign.remaining;
            campaign.remaining = 0;
            address fundedBy = campaign.fundedByAdmin
                ? adminTreasury
                : advertiser.addr;
            require(doc.transfer(fundedBy, remaining), "rdc 3");
            emit CampaignSaved(campaign);
        }
    }

    // To prevent race conditions, we never mint while we're in the middle of a payout.
    function _safeMint(address _addr, uint256 _amount) private {
        recentTokens[getCurrentCycle()] += _amount;
        _mint(_addr, _amount);
    }

    struct AdminSetPriceInput {
        uint256 handleId;
        uint256 price;
    }

    function adminSetPrice(
        AdminSetPriceInput[] calldata _inputs
    ) external onlyAdmin {
        for (uint256 i = 0; i < _inputs.length; i++) {
            Handle storage handle = handles[_inputs[i].handleId - 1];
            Account storage account = accounts[handle.accountId];
            require(account.addr == address(0) && account.id > 0);

            _setPriceHelper(handle, _inputs[i].price);
        }
    }

    function setPrice(uint256 _handleId, uint256 _price) external {
        Account storage account = accounts[accountIdByAddress[msg.sender]];
        require(account.addr != address(0));

        Handle storage handle = handles[_handleId - 1];
        require(handle.id > 0);
        require(handle.accountId == account.id);

        _setPriceHelper(handle, _price);
    }

    function _setPriceHelper(Handle storage handle, uint256 _price) private {
        require(_price > 0);
        handle.newPrice = _price;
        handle.needsUpdate = true;
        emit HandleSaved(handle);
    }

    struct AdminSetScoreAndTopicsInput {
        uint256 handleId;
        uint256 score;
        uint256[] topics;
    }

    function adminSetScoreAndTopics(
        AdminSetScoreAndTopicsInput[] calldata _inputs
    ) external onlyAdmin {
        for (uint256 i = 0; i < _inputs.length; i++) {
            Handle storage handle = handles[_inputs[i].handleId - 1];
            handle.newScore = _inputs[i].score;
            handle.newTopics = _inputs[i].topics;
            handle.needsUpdate = true;
            emit HandleSaved(handle);
        }
    }

    function getCycleLength() public pure returns (uint256) {
        return 60 * 60 * 24 * 15;
    }

    function getCurrentCycle() public view returns (uint256) {
        return block.timestamp / getCycleLength();
    }

    function getNextCycle() public view returns (uint256) {
        return getCurrentCycle() + getCycleLength();
    }

    uint256 public feePool;
    struct BalanceChange {
        uint256 added;
        uint256 substracted;
    }
    mapping(uint256 => mapping(address => BalanceChange))
        public recentBalanceChanges;
    mapping(uint256 => BalanceChange) public recentFeePoolChanges;
    mapping(uint256 => uint256) public recentTokens;
    mapping(address => uint256) public lastFeePoolShareCycles;

    function getRecentBalanceChange(
        address _holder
    ) public view returns (BalanceChange memory) {
        return recentBalanceChanges[getCurrentCycle()][_holder];
    }

    function getBalanceBeforeRecentChanges(
        address _holder
    ) public view returns (uint256) {
        BalanceChange storage recent = recentBalanceChanges[getCurrentCycle()][
            _holder
        ];
        return (balanceOf(_holder) + recent.substracted) - recent.added;
    }

    function _registerRecentBalanceChange(
        address _holder,
        uint256 _amount,
        bool _added
    ) private {
        BalanceChange storage recent = recentBalanceChanges[getCurrentCycle()][
            _holder
        ];
        if (_added) {
            recent.added += _amount;
        } else {
            recent.substracted += _amount;
        }
    }

    function changeFeePool(uint256 _amount, bool _added) private {
        BalanceChange storage recent = recentFeePoolChanges[getCurrentCycle()];
        if (_added) {
            feePool += _amount;
            recent.added += _amount;
        } else {
            feePool -= _amount;
            recent.substracted += _amount;
        }
    }

    function getFeePoolBeforeRecentChanges() public view returns (uint256) {
        BalanceChange storage recent = recentFeePoolChanges[getCurrentCycle()];
        return (feePool + recent.substracted) - recent.added;
    }

    function claimFeePoolShare(
        address[] calldata _holders
    ) external nonReentrant {
        uint256 current = getCurrentCycle();
        uint256 supply = totalSupply() - recentTokens[current];
        uint256 pool = getFeePoolBeforeRecentChanges();
        require(supply > 0, "cfps0");
        require(pool > 0, "cfps1");

        for (uint256 i = 0; i < _holders.length; i++) {
            address holder = _holders[i];

            require(lastFeePoolShareCycles[holder] < current, "cfps2");

            uint256 balance = getBalanceBeforeRecentChanges(holder);
            require(balance > 0, "cfps3");
            uint256 reward = (balance * pool) / supply;

            lastFeePoolShareCycles[holder] = current;
            changeFeePool(reward, false);

            require(doc.transfer(holder, reward), "cfps4");
        }
    }

    function applyHandleUpdates(uint256[] calldata _indexes) external {
        uint256 currentCycle = getCurrentCycle();

        for (uint256 i = 0; i < _indexes.length; i++) {
            Handle storage handle = handles[_indexes[i]];
            require(handle.lastUpdated != currentCycle, "ahu 0");
            require(handle.needsUpdate, "ahu 0");

            handle.needsUpdate = false;
            handle.lastUpdated = currentCycle;

            if (bytes(handle.newUsername).length > 0) {
                handle.username = handle.newUsername;
            }

            if (handle.newPrice != 0) {
                handle.price = handle.newPrice;
            }

            if (handle.score != 0) {
                handle.score = handle.newScore;
            }

            if (handle.newTopics.length > 0) {
                handle.topics = handle.newTopics;
            }

            emit HandleSaved(handle);
        }
    }

    function applyVotedFeeRate() external {
        uint256 currentCycle = getCurrentCycle();
        require(currentCycle != lastVotedFeeRateAppliedOn);
        feeRate = votedFeeRate;
        lastVotedFeeRateAppliedOn = currentCycle;
    }

    function submitFeeRateVote(uint256 _rate) external {
        require(_rate > 0 && _rate < 1e20, "sfrv 0");

        FeeRateVote storage vote = feeRateVotes[msg.sender];
        if (vote.votes > 0) {
            removeFeeRateVoteHelper(msg.sender);
        }

        uint256 votes = balanceOf(msg.sender);
        require(votes > 0, "sfrv 1");

        votedFeeRate =
            ((votedFeeRate * votedFeeRateVoteCount) + (votes * _rate)) /
            (votedFeeRateVoteCount + votes);
        votedFeeRateVoteCount += votes;
        vote.votes = votes;
        vote.rate = _rate;
    }

    function removeFeeRateVote() external {
        removeFeeRateVoteHelper(msg.sender);
    }

    function removeFeeRateVoteHelper(address _holder) private {
        FeeRateVote storage vote = feeRateVotes[_holder];
        require(vote.votes > 0, "rfrv 0");
        uint256 nextVoteCount = votedFeeRateVoteCount - vote.votes;
        uint256 currentVolume = votedFeeRate * votedFeeRateVoteCount;
        uint256 removedVolume = vote.votes * vote.rate;
        uint256 nextVolume = currentVolume > removedVolume
            ? currentVolume - removedVolume
            : 0;

        if (nextVoteCount > 0) {
            votedFeeRate = nextVolume / nextVoteCount;
            votedFeeRateVoteCount = nextVoteCount;
        } else {
            votedFeeRate = defaultFeeRate;
            votedFeeRateVoteCount = 0;
        }
        delete feeRateVotes[_holder];
    }

    function submitAdminVote(address _candidate) external {
        require(_candidate != address(0), "sav 0");
        uint256 votes = balanceOf(msg.sender);
        require(votes > 0, "sav 1");

        AdminVote storage existing = submittedAdminVotes[msg.sender];
        if (existing.votes > 0) {
            removeAdminVoteHelper(msg.sender);
        }

        submittedAdminVotes[msg.sender] = AdminVote({
            candidate: _candidate,
            votes: votes,
            cycle: getCurrentCycle(),
            vested: false
        });

        emit AdminVoteSaved(submittedAdminVotes[msg.sender]);
    }

    function vestAdminVotes(address[] calldata _holders) external {
        uint256 thisCycle = getCurrentCycle();

        for (uint256 i = 0; i < _holders.length; i++) {
            AdminVote storage vote = submittedAdminVotes[_holders[i]];
            require(vote.cycle > 0, "vav 0");
            require(vote.cycle < thisCycle, "vav 1");
            require(!vote.vested, "vav 2");
            vote.vested = true;
            vestedAdminVotesTotal += vote.votes;

            uint256 voteCountId = adminVoteCountIdByCandidate[vote.candidate];
            if (voteCountId > 0) {
                AdminVoteCount storage count = adminVoteCounts[voteCountId - 1];
                count.votes += vote.votes;
            } else {
                AdminVoteCount storage count = adminVoteCounts.push();
                count.votes = vote.votes;
                count.candidate = vote.candidate;
                adminVoteCountIdByCandidate[vote.candidate] = adminVoteCounts
                    .length;
            }
            emit AdminVoteSaved(vote);
        }
    }

    function proclaimCycleAdminWinner(address _candidate) external {
        uint256 voteCountId = adminVoteCountIdByCandidate[_candidate];
        require(voteCountId > 0);
        AdminVoteCount storage count = adminVoteCounts[voteCountId - 1];

        require(count.votes > vestedAdminVotesTotal / 2, "pcw 0");
        require(vestedAdminVotesTotal > 0, "pcw 1");
        uint256 thisCycle = getCurrentCycle();
        require(lastAdminElection < thisCycle, "pcw 2");

        lastAdminElection = thisCycle;
        latestAdminElections[2] = latestAdminElections[1];
        latestAdminElections[1] = latestAdminElections[0];
        latestAdminElections[0] = _candidate;

        if (
            _candidate == latestAdminElections[1] &&
            _candidate == latestAdminElections[2]
        ) {
            admin = _candidate;
            adminTreasury = _candidate;
        }
    }

    function removeAdminVote() external {
        removeAdminVoteHelper(msg.sender);
    }

    function removeAdminVoteHelper(address _holder) private {
        AdminVote storage vote = submittedAdminVotes[_holder];
        require(vote.votes > 0, "ravh 0");
        if (vote.vested) {
            vestedAdminVotesTotal -= vote.votes;

            uint256 voteCountId = adminVoteCountIdByCandidate[vote.candidate];
            require(voteCountId > 0);
            adminVoteCounts[voteCountId - 1].votes -= vote.votes;
        }
        delete submittedAdminVotes[_holder];
    }

    function setAdminAddress(address _admin) external {
        require(msg.sender == adminTreasury);
        admin = _admin;
    }

    function isSubset(
        uint256[] memory mainSet,
        uint256[] memory subset
    ) public pure returns (bool) {
        for (uint256 i = 0; i < subset.length; i++) {
            bool found = false;

            for (uint256 j = 0; j < mainSet.length; j++) {
                if (subset[i] == mainSet[j]) {
                    found = true;
                    break;
                }
            }

            if (!found) {
                return false;
            }
        }

        return true;
    }
}

contracts/AsamiCore.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.19;
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Capped.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "./Asami.sol";

contract AsamiCore is ERC20Capped, ReentrancyGuard {
    /* 
      Contract tracks time in 15 day cycles from the moment it was deployed.
      This cycle marks how often new voted fee rates are applied, how often revenue sharing happens,
      and the new asami token issuance.
    */
    uint256 initialCycle;
    uint256 cycleLength = 60 * 60 * 24 * 15;

    function getCurrentCycle() public view returns (uint256) {
        return (block.timestamp / cycleLength) - initialCycle;
    }

    struct Account {
        /* 
        The trusted admin is used to register collaborations in the campaigns this account creates.
        Accounts with to trusted admin cannot run campaigns.

        It can also perform gasless claims.
        Accounts with no trusted admin can have their gasless claims executed by anyone.
				*/
        address trustedAdmin;

				/* 
				These are a contract enforced safety rule for gasless claims,
				to make sure your trusted admin cannot steal from you.
				*/
        uint256 maxGaslessDocToSpend;
        uint256 minGaslessRbtcToReceive;

				/*
				Paying out all participants gets too expensive for the oracle.
				Instead everyone gets paid to their unclaimed balance, and they can
				decide when to withdraw it.
				*/
        uint256 unclaimedAsamiBalance;
        uint256 unclaimedDocBalance;

				/*
				This is your personal fee rate when you're acting as an admin.
				Collaborations registered by you will pay you this percentage in fee.
				This is in addition to the global Asami fee.
				*/
        uint256 feeRateWhenAdmin;

				/*
				This is your voted fee rate, which moves the global fee closer to what you want it to be.
				*/
        FeeRateVote feeRateVote;
        mapping(uint256 => Campaign) campaigns;
        mapping(uint256 => SubAccount) subAccounts;
    }
    mapping(address => Account) public accounts;

    /*
		Sub accounts can be used by someone acting as an admin to collect rewards on behalf
		of someone who does not have an account yet, usually a web2 user.
		Sub accounts can then be promoted to accounts by the admin.
    */
    struct SubAccount {
        uint256 unclaimedAsamiBalance;
        uint256 unclaimedDocBalance;
    }

    function getSubAccount(
        address _account,
        uint256 _index
    ) public view returns (SubAccount memory) {
        return accounts[_account].subAccounts[_index];
    }

    struct Campaign {
        uint256 budget;
        uint256 validUntil;
        uint256 reportHash;
    }

    function getCampaign(
        address _account,
        uint256 _briefingHash
    ) public view returns (Campaign memory) {
        return accounts[_account].campaigns[_briefingHash];
    }

		/*
		What should the global asami protocol fee - collected from each collaboration - be?
		Token holders vote on this locking their tokens. The fee value is a weighted average for all votes.
		To make the protocol more predictable, the actual fee is only changed once every 15 day cycle.
		But anyone can vote at any time.
		When a holder reduces their holdings, their vote is removed.
		If they receive more tokens, their vote maintains its weight. To use the new weight, they should vote again.
		*/
    uint256 public defaultFeeRate = 10 * 1e18;
    uint256 public feeRate = defaultFeeRate;
    uint256 public votedFeeRate = defaultFeeRate;
    uint256 public votedFeeRateVoteCount = 0;
    uint256 public lastVotedFeeRateAppliedOn = 0;

    struct FeeRateVote {
        uint256 votes;
        uint256 rate;
    }

		/*
		All rewards are to be paid in the DOC stablecoin.
		We could, in theory, have a version of this contract deployed that does not use DOC by just changing this.
		*/
    IERC20 internal doc;

		/*
	  Since Asami tokens can be assigned to the account's unclaimed balance, instead of minted, we keep
		a separate counter for the amount of tokens that were just assigned.
		*/
    uint256 public assignedAsamiTokens;

    event CampaignCreated(address account, uint256 campaignId);
    event CampaignExtended(address account, uint256 campaignId);
    event CampaignToppedUp(address account, uint256 campaignId);
    event CampaignReimbursed(address account, uint256 campaignId);

    constructor(
        address _dollarOnChainAddress
    ) ERC20("Asami Core", "ASAMI") ERC20Capped(21 * 1e24) {
        doc = IERC20(_dollarOnChainAddress);
        adminTreasury = msg.sender;
        initialCycle = block.timestamp / cycleLength;
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        super._beforeTokenTransfer(from, to, amount);
        if (from != address(0)) {
            _registerRecentBalanceChange(from, amount, false);

            if (accounts[from].feeRateVote.votes > 0) {
                removeFeeRateVoteHelper(from);
            }
        }

        if (to != address(0)) {
            _registerRecentBalanceChange(to, amount, true);
        }
    }

    struct PromoteSubAccountsParam {
        uint256 id;
        address addr;
    }

    // Anyone acting as an Admin can onboard web2 users as sub-accounts.
    // The admin still has full control of the subaccount funds until giving them away.
    // This function is only for convenience, it could easily be replaced by a custom admin
    // process that uses this function to send sub-account funds to the admin's own address,
    // and then decides how much to forward to the claiming user.
    function promoteSubAccounts(
        PromoteSubAccountsParam[] calldata _params
    ) external nonReentrant {
        for (uint256 i = 0; i < _params.length; i++) {
            PromoteSubAccountsParam calldata param = _params[i];
            SubAccount storage sub = accounts[msg.sender].subAccounts[param.id];
            Account storage account = accounts[param.addr];
            require(
                account.trustedAdmin == msg.sender ||
                    account.trustedAdmin == address(0),
                "psa0"
            );

            account.unclaimedAsamiBalance += sub.unclaimedAsamiBalance;
            sub.unclaimedAsamiBalance = 0;

            uint256 promotedDocAmount = sub.unclaimedDocBalance;
            account.unclaimedDocBalance += sub.unclaimedDocBalance;
            sub.unclaimedDocBalance = 0;

            // Accounts not claimed by anyone yet can be claimed by any admin.
            // The TrustedAdmin has no permissions other than for funding the account payouts.
            // The account holder can always configure this at will after getting some RBTC.
            if (account.trustedAdmin == address(0)) {
                account.trustedAdmin = msg.sender;
                // The amount left in the sub account is the highest amount we know the
                // user is comfortable leaving to the admin's best judgement.
                // It should be at least 1 DOC, otherwise users who claim too early would
                // end up in an inconvenient situation without enough RBTC, and nobody to help them.
                account.maxGaslessDocToSpend = promotedDocAmount > 1e18
                    ? promotedDocAmount
                    : 1e18;

                // The admin must send at least enough RBTC for 100.000 gas.
                // 100.000 gas is more than enough for the user to reconfigure their account
                // selecting another admin and reducing these numbers.
                // Also to send their DOC and spend them somewhere.
                account.minGaslessRbtcToReceive = 6e12;
            }
        }
    }

    function configAccount(
        address _trustedAdmin,
        uint256 _maxGaslessDocToSpend,
        uint256 _minGaslessRbtcToReceive,
        uint256 _feeRateWhenAdmin
    ) external {
        Account storage account = accounts[msg.sender];
        account.trustedAdmin = _trustedAdmin;
        account.maxGaslessDocToSpend = _maxGaslessDocToSpend;
        account.minGaslessRbtcToReceive = _minGaslessRbtcToReceive;
        account.feeRateWhenAdmin = _feeRateWhenAdmin;
    }

    function claimBalances() external nonReentrant {
        Account storage account = accounts[msg.sender];

        if (account.unclaimedAsamiBalance > 0) {
            uint256 balance = account.unclaimedAsamiBalance;
            account.unclaimedAsamiBalance = 0;
            _safeMint(msg.sender, balance);
        }

        if (account.unclaimedDocBalance > 0) {
            uint256 balance = account.unclaimedDocBalance;
            account.unclaimedDocBalance = 0;
            doc.transfer(msg.sender, balance);
        }
    }

    function adminClaimBalancesFree(
        address[] calldata _addresses
    ) external nonReentrant {
        for (uint256 i = 0; i < _addresses.length; i++) {
            Account storage account = accounts[_addresses[i]];
            require(
                account.trustedAdmin == msg.sender ||
                    _addresses[i] == msg.sender,
                "acb0"
            );

            if (account.unclaimedAsamiBalance > 0) {
                uint256 balance = account.unclaimedAsamiBalance;
                account.unclaimedAsamiBalance = 0;
                _safeMint(_addresses[i], balance);
            }

            if (account.unclaimedDocBalance > 0) {
                uint256 balance = account.unclaimedDocBalance;
                account.unclaimedDocBalance = 0;
                doc.transfer(_addresses[i], balance);
            }
        }
    }

    function gaslessClaimBalances(
        uint256 _fee,
        uint256 _rbtcAmount,
        address[] calldata _addresses
    ) external payable nonReentrant {
        require(_rbtcAmount > 1e11, "gcb0");
        require(msg.value == (_rbtcAmount * _addresses.length), "gcb1");

        for (uint256 i = 0; i < _addresses.length; i++) {
            Account storage account = accounts[_addresses[i]];
            require(
                account.trustedAdmin == msg.sender ||
                    account.trustedAdmin == address(0),
                "gcb2"
            );
            require(account.unclaimedDocBalance > _fee, "gcb3");
            require(account.maxGaslessDocToSpend >= _fee, "gcb4");
            require(_rbtcAmount >= account.minGaslessRbtcToReceive, "gcb5");

            uint256 docs = account.unclaimedDocBalance - _fee;
            account.unclaimedDocBalance = 0;
            doc.transfer(_addresses[i], docs);
            accounts[msg.sender].unclaimedDocBalance += _fee;
            payable(_addresses[i]).transfer(_rbtcAmount);

            if (account.unclaimedAsamiBalance > 0) {
                uint256 balance = account.unclaimedAsamiBalance;
                account.unclaimedAsamiBalance = 0;
                _safeMint(_addresses[i], balance);
            }
        }
    }

    struct MakeCampaignsParam {
        uint256 budget;
        uint256 validUntil;
        uint256 briefingHash;
    }

    function setTrustedAdminAndMakeCampaign(
        address _trustedAdmin,
        MakeCampaignsParam[] calldata _inputs
    ) public nonReentrant {
        Account storage account = accounts[msg.sender];
        account.trustedAdmin = _trustedAdmin;
        makeCampaigns(_inputs);
    }

    function makeCampaigns(
        MakeCampaignsParam[] calldata _inputs
    ) public nonReentrant {
        Account storage account = accounts[msg.sender];

        for (uint i = 0; i < _inputs.length; i++) {
            MakeCampaignsParam memory input = _inputs[i];
            require(input.budget > 0, "mc0");
            require(input.validUntil > block.timestamp, "mc1");
            Campaign storage c = account.campaigns[input.briefingHash];
            c.budget = input.budget;
            c.validUntil = input.validUntil;
            require(
                doc.transferFrom(msg.sender, address(this), input.budget),
                "mc2"
            );

            emit CampaignCreated(msg.sender, input.briefingHash);
        }
    }

    /* A campaign's expiration can be extended, and this will mean that
       people will be able to participate for longer, but also that the funds
       locked in it will be held longer.
       That's why only the advertiser can call this, knowing their money will be held longer.
    */
    struct ExtendCampaignsParam {
        uint256 validUntil;
        uint256 briefingHash;
    }

    function extendCampaigns(
        ExtendCampaignsParam[] calldata _inputs
    ) public nonReentrant {
        Account storage account = accounts[msg.sender];

        for (uint i = 0; i < _inputs.length; i++) {
            ExtendCampaignsParam memory input = _inputs[i];
            Campaign storage c = account.campaigns[input.briefingHash];
            require(c.validUntil != 0, "ec1");
            require(input.validUntil > c.validUntil, "ec2");
            c.validUntil = input.validUntil;
            c.reportHash = 0;

            emit CampaignExtended(msg.sender, input.briefingHash);
        }
    }

    struct TopUpCampaignsParam {
        address account;
        uint256 budget;
        uint256 briefingHash;
    }

    function topUpCampaigns(
        TopUpCampaignsParam[] calldata _inputs
    ) public nonReentrant {
        for (uint i = 0; i < _inputs.length; i++) {
            TopUpCampaignsParam memory input = _inputs[i];
            require(input.budget > 0, "tc0");
            require(input.account != address(0), "tc1");

            Account storage account = accounts[input.account];
            Campaign storage c = account.campaigns[input.briefingHash];

            require(c.validUntil > block.timestamp, "tc2");

            c.budget += input.budget;

            require(
                doc.transferFrom(msg.sender, address(this), input.budget),
                "tc3"
            );
            emit CampaignToppedUp(input.account, input.briefingHash);
        }
    }

    struct ReimburseCampaignsParam {
        address addr;
        uint256 briefingHash;
    }

    function reimburseCampaigns(
        ReimburseCampaignsParam[] calldata _inputs
    ) external nonReentrant {
        for (uint i = 0; i < _inputs.length; i++) {
            ReimburseCampaignsParam memory input = _inputs[i];

            Account storage account = accounts[input.addr];
            Campaign storage campaign = account.campaigns[input.briefingHash];
            require(campaign.budget > 0, "rc0");
            require(campaign.validUntil < block.timestamp, "rc1");

            require(doc.transfer(input.addr, campaign.budget), "rc2");
            campaign.budget = 0;

            emit CampaignReimbursed(input.addr, input.briefingHash);
        }
    }

    struct SubmitReportsParam {
        address account;
        uint256 briefingHash;
        uint256 reportHash;
    }

    function submitReports(SubmitReportsParam[] calldata _inputs) external {
        for (uint i = 0; i < _inputs.length; i++) {
            SubmitReportsParam memory input = _inputs[i];
            require(input.reportHash > 0, "sr0");

            Account storage account = accounts[input.account];
            require(account.trustedAdmin == msg.sender, "sr1");

            Campaign storage campaign = account.campaigns[input.briefingHash];
            require(campaign.validUntil > 0, "sr2");
            require(campaign.validUntil < block.timestamp, "sr3");
            require(campaign.reportHash == 0, "sr4");
            campaign.reportHash = input.reportHash;
        }
    }

    struct MakeCollabsParam {
        address advertiserAddr;
        uint256 briefingHash;
        MakeCollabsParamItem[] collabs;
    }

    struct MakeCollabsParamItem {
        address accountAddr;
        uint256 docReward;
    }

    /* Make sure all the accounts involved are marked as claimed (?) */
    function adminMakeCollabs(
        MakeCollabsParam[] calldata _input
    ) external nonReentrant {
        /* It's impossible to make collabs if the fees would exceed the reward */
        require(
            (feeRate + accounts[msg.sender].feeRateWhenAdmin) < 100e18,
            "amc0"
        );

        for (uint256 i = 0; i < _input.length; i++) {
            Account storage advertiser = accounts[_input[i].advertiserAddr];
            Campaign storage campaign = advertiser.campaigns[
                _input[i].briefingHash
            ];
            require(advertiser.trustedAdmin == msg.sender, "amc1");
            require(campaign.validUntil > block.timestamp, "amc2");

            uint256 newFees = 0;

            for (uint256 j = 0; j < _input[i].collabs.length; j++) {
                Account storage admin = accounts[msg.sender];
                MakeCollabsParamItem calldata item = _input[i].collabs[j];
                require(item.accountAddr != address(0), "amc3");

                uint256 gross = item.docReward;
                require(campaign.budget >= gross, "amc4");
                campaign.budget -= gross;

                uint256 fee = (gross * feeRate) / 1e20;
                uint256 adminFee = (gross * admin.feeRateWhenAdmin) / 1e20;
                uint256 reward = gross - fee - adminFee;

                uint256 memberTokens = _tryAssigningTokensAndReturnMemberTokens(
                    fee,
                    advertiser,
                    admin
                );
                if (memberTokens > 0) {
                    accounts[item.accountAddr]
                        .unclaimedAsamiBalance += memberTokens;
                }
                accounts[item.accountAddr].unclaimedDocBalance += reward;
                newFees += fee;
                admin.unclaimedDocBalance += adminFee;
            }

            /* To save on gas costs, values are added in memory then stored at once */
            changeFeePool(newFees, true);

            /* 
            Storing the fee amount collected in this cycle is only
            useful to adjust the issuance rate on the next cycle.
            If we've issued al tokens, there's no point in adjusting the
            issuance rate on next cycle, therefore, no point in storing this value
          */
            if (assignedAsamiTokens < cap()) {
                feesCollectedPerCycleDuringTokenIssuance[
                    getCurrentCycle()
                ] += newFees;
            }
        }
    }

    struct MakeSubAccountCollabsParam {
        address advertiserAddr;
        uint256 briefingHash;
        MakeSubAccountCollabsParamItem[] collabs;
    }

    struct MakeSubAccountCollabsParamItem {
        uint256 subAccountId;
        uint256 docReward;
    }

    /* Make sure all the accounts involved are marked as claimed (?) */
    function adminMakeSubAccountCollabs(
        MakeSubAccountCollabsParam[] calldata _input
    ) external nonReentrant {
        /* It's impossible to make collabs if the fees would exceed the reward */
        require(
            (feeRate + accounts[msg.sender].feeRateWhenAdmin) < 100e18,
            "amc0"
        );

        for (uint256 i = 0; i < _input.length; i++) {
            Account storage advertiser = accounts[_input[i].advertiserAddr];
            Campaign storage campaign = advertiser.campaigns[
                _input[i].briefingHash
            ];
            require(advertiser.trustedAdmin == msg.sender, "amc1");
            require(campaign.validUntil > block.timestamp, "amc2");

            uint256 newFees = 0;

            for (uint256 j = 0; j < _input[i].collabs.length; j++) {
                Account storage admin = accounts[msg.sender];
                MakeSubAccountCollabsParamItem calldata item = _input[i]
                    .collabs[j];

                uint256 gross = item.docReward;
                require(campaign.budget >= gross, "amc4");
                campaign.budget -= gross;

                uint256 fee = (gross * feeRate) / 1e20;
                uint256 adminFee = (gross * admin.feeRateWhenAdmin) / 1e20;
                uint256 reward = gross - fee - adminFee;

                uint256 memberTokens = _tryAssigningTokensAndReturnMemberTokens(
                    fee,
                    advertiser,
                    admin
                );
                if (memberTokens > 0) {
                    admin
                        .subAccounts[item.subAccountId]
                        .unclaimedAsamiBalance += memberTokens;
                }
                admin
                    .subAccounts[item.subAccountId]
                    .unclaimedDocBalance += reward;
                newFees += fee;
                admin.unclaimedDocBalance += adminFee;
            }

            /* To save on gas costs, values are added in memory then stored at once */
            changeFeePool(newFees, true);

            /* 
            Storing the fee amount collected in this cycle is only
            useful to adjust the issuance rate on the next cycle.
            If we've issued al tokens, there's no point in adjusting the
            issuance rate on next cycle, therefore, no point in storing this value
          */
            if (assignedAsamiTokens < cap()) {
                feesCollectedPerCycleDuringTokenIssuance[
                    getCurrentCycle()
                ] += newFees;
            }
        }
    }

    function _tryAssigningTokensAndReturnMemberTokens(
        uint256 _fee,
        Account storage _advertiser,
        Account storage _admin
    ) private returns (uint256) {
        uint256 remainingToCap = cap() - assignedAsamiTokens;

        if (remainingToCap > 0) {
            uint256 tokensAtRate = getIssuanceFor(_fee);
            uint256 newTokens = (tokensAtRate > remainingToCap)
                ? remainingToCap
                : tokensAtRate;
            uint256 advertiserTokens = (newTokens * 30 * 1e18) / 100e18;
            uint256 memberTokens = (newTokens * 30 * 1e18) / 100e18;

            if (newTokens > 0) {
                _advertiser.unclaimedAsamiBalance += advertiserTokens;
                _admin.unclaimedAsamiBalance +=
                    newTokens -
                    advertiserTokens -
                    memberTokens;
                assignedAsamiTokens += newTokens;
                return memberTokens;
            }
        }

        return 0;
    }

    function _safeMint(address _addr, uint256 _amount) private {
        recentTokens[getCurrentCycle()] += _amount;
        _mint(_addr, _amount);
    }

    /* 
      The feePool accumulates all the protocol fees to be distributed at the end of each cycle.
      The feePool is distributed based on holder balances at the end of the cycle.
    */
    uint256 public feePool;

    struct BalanceChange {
        uint256 added;
        uint256 substracted;
    }
    mapping(uint256 => mapping(address => BalanceChange))
        public recentBalanceChanges;
    mapping(uint256 => BalanceChange) public recentFeePoolChanges;
    mapping(uint256 => uint256) public recentTokens;
    mapping(address => uint256) public lastFeePoolShareCycles;

    function getRecentBalanceChange(
        address _holder
    ) public view returns (BalanceChange memory) {
        return recentBalanceChanges[getCurrentCycle()][_holder];
    }

    function getBalanceBeforeRecentChanges(
        address _holder
    ) public view returns (uint256) {
        BalanceChange storage recent = recentBalanceChanges[getCurrentCycle()][
            _holder
        ];
        return (balanceOf(_holder) + recent.substracted) - recent.added;
    }

    function _registerRecentBalanceChange(
        address _holder,
        uint256 _amount,
        bool _added
    ) private {
        BalanceChange storage recent = recentBalanceChanges[getCurrentCycle()][
            _holder
        ];
        if (_added) {
            recent.added += _amount;
        } else {
            recent.substracted += _amount;
        }
    }

    function changeFeePool(uint256 _amount, bool _added) private {
        BalanceChange storage recent = recentFeePoolChanges[getCurrentCycle()];
        if (_added) {
            feePool += _amount;
            recent.added += _amount;
        } else {
            feePool -= _amount;
            recent.substracted += _amount;
        }
    }

    function getFeePoolBeforeRecentChanges() public view returns (uint256) {
        BalanceChange storage recent = recentFeePoolChanges[getCurrentCycle()];
        return (feePool + recent.substracted) - recent.added;
    }

    function claimFeePoolShare(
        address[] calldata _holders
    ) external nonReentrant {
        uint256 current = getCurrentCycle();
        uint256 supply = totalSupply() - recentTokens[current];
        uint256 pool = getFeePoolBeforeRecentChanges();
        require(supply > 0, "cfp0");
        require(pool > 0, "cfp1");

        for (uint256 i = 0; i < _holders.length; i++) {
            address holder = _holders[i];

            require(lastFeePoolShareCycles[holder] < current, "cfp2");

            uint256 balance = getBalanceBeforeRecentChanges(holder);
            require(balance > 0, "cfp3");
            uint256 reward = (balance * pool) / supply;

            lastFeePoolShareCycles[holder] = current;
            changeFeePool(reward, false);

            require(doc.transfer(holder, reward), "cfp4");
        }
    }

    function applyVotedFeeRate() external {
        uint256 currentCycle = getCurrentCycle();
        require(currentCycle != lastVotedFeeRateAppliedOn, "afr0");
        feeRate = votedFeeRate;
        lastVotedFeeRateAppliedOn = currentCycle;
    }

    function submitFeeRateVote(uint256 _rate) external {
        require(_rate > 0 && _rate < 100e18, "srv0");

        FeeRateVote storage vote = accounts[msg.sender].feeRateVote;
        if (vote.votes > 0) {
            removeFeeRateVoteHelper(msg.sender);
        }

        uint256 votes = balanceOf(msg.sender);
        require(votes > 0, "srv1");

        votedFeeRate =
            ((votedFeeRate * votedFeeRateVoteCount) + (votes * _rate)) /
            (votedFeeRateVoteCount + votes);
        votedFeeRateVoteCount += votes;
        vote.votes = votes;
        vote.rate = _rate;
    }

    function removeFeeRateVote() external {
        removeFeeRateVoteHelper(msg.sender);
    }

    function removeFeeRateVoteHelper(address _holder) private {
        FeeRateVote storage vote = accounts[_holder].feeRateVote;
        require(vote.votes > 0, "rfrv 0");
        uint256 nextVoteCount = votedFeeRateVoteCount - vote.votes;
        uint256 currentVolume = votedFeeRate * votedFeeRateVoteCount;
        uint256 removedVolume = vote.votes * vote.rate;
        uint256 nextVolume = currentVolume > removedVolume
            ? currentVolume - removedVolume
            : 0;

        if (nextVoteCount > 0) {
            votedFeeRate = nextVolume / nextVoteCount;
            votedFeeRateVoteCount = nextVoteCount;
        } else {
            votedFeeRate = defaultFeeRate;
            votedFeeRateVoteCount = 0;
        }
        delete accounts[_holder].feeRateVote;
    }

    /* Asami token issuance rate:
      The issuance goal is 100.000 tokens every 15 days until reaching 21.000.000 (a little above 1 year).
      That is, tokens will be issued in 210 cycles.
      Tokens are assigned to people paying into the fees pool.
      For every cycle we calculate the previous 10 cycles average fees, and come up with an equivalence of DoC paid vs tokens awarded.
      This equivalence is stored and updated for every cycle, and should adjust issuance to target 100.000 tokens every cycle.
    */
    uint256 public tokensTargetPerCycle = 100000e18;
    mapping(uint256 => uint256) public feesCollectedPerCycleDuringTokenIssuance;

    // The amount of tokens to issue for a given number of DOC collected as fee.
    //  According to last cycle's collected fees and the tokens target per cycle.
    function getIssuanceFor(uint256 _docAmount) public view returns (uint256) {
        uint256 current = getCurrentCycle();

        /* The initial value is roughly based on the fees collected by V1 during it's lifetime */
        if (current == 0) {
            return _docAmount * 4000;
        }

        // If for whatever reason we have a cycle in which we didn't collect fees,
        // we issue tokens like we had collected 100 DOC in fees for that period.
        // This is an intentionally low amount mostly to avoid dividing by zero.
        uint256 prev = feesCollectedPerCycleDuringTokenIssuance[current - 1];
        return
            (_docAmount * tokensTargetPerCycle) / (prev == 0 ? 100e18 : prev);
    }

    function getFeesCollected(uint256 _cycle) public view returns (uint256) {
        return feesCollectedPerCycleDuringTokenIssuance[_cycle];
    }

    /* The adminTreasury address is the deployer address which can only be used to retrieve accidentally sent RBTC into the contract. */
    address public adminTreasury;

    function withdrawAccidentallySentRbtc() external {
        require(msg.sender == adminTreasury, "wasr0");
        payable(adminTreasury).transfer(address(this).balance);
    }

    /* 
       This is the migration from the old contract.
       It only issues new asami tokens to these users again,
       based on the tokens they had in the previous version of the contract.
    */
    uint256 public migrationCursor;
    bool public migrationHoldersDone;
    bool public migrationAccountsDone;

    function migrateTokensFromOldContract(
        address _oldContract,
        address _adminAddr,
        uint256 _items
    ) external {
        require(!migrationHoldersDone || !migrationAccountsDone, "mig0");
        Asami oldContract = Asami(_oldContract);
        assignedAsamiTokens = oldContract.claimedAsamiTokens();
        Account storage admin = accounts[_adminAddr];

        if (!migrationHoldersDone) {
            for (uint256 i = 0; i < _items; i++) {
                try oldContract.holders(migrationCursor + i) returns (
                    address holder
                ) {
                    uint256 balance = getIssuanceFor(
                        oldContract.balanceOf(holder)
                    );
                    if (balance > 0) {
                        _safeMint(holder, balance);
                    }
                } catch {
                    migrationHoldersDone = true;
                    break;
                }
            }
        }

        if (!migrationAccountsDone) {
            for (uint256 i = 0; i < _items; i++) {
                try oldContract.accountIds(migrationCursor + i) returns (
                    uint256 oldAccountId
                ) {
                    (, address addr, uint256 oldUnclaimedAsami, ) = oldContract
                        .accounts(oldAccountId);
                    if (addr == address(0) && oldUnclaimedAsami > 0) {
                        admin
                            .subAccounts[oldAccountId]
                            .unclaimedAsamiBalance = getIssuanceFor(
                            oldUnclaimedAsami
                        );
                    }
                    if (addr != address(0)) {
                        // These values are set only once during the migration, for accounts
                        // that existed in the previous contract.
                        // This ensures a smooth migration and that the admin is immediately able
                        // to manage these accounts, provinding gasless claims at reasonable prices.
                        accounts[addr].trustedAdmin = _adminAddr;
                        accounts[addr].maxGaslessDocToSpend = 1e18;
                        accounts[addr].minGaslessRbtcToReceive = 6e12;
                    }
                } catch {
                    migrationAccountsDone = true;
                    break;
                }
            }
        }

        migrationCursor += _items;
    }
}

contracts/Lock.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.19;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Lock {
    uint public unlockTime;
    address payable public owner;

    event Withdrawal(uint amount, uint when);

    constructor(uint _unlockTime) payable {
        require(
            block.timestamp < _unlockTime,
            "Unlock time should be in the future"
        );

        unlockTime = _unlockTime;
        owner = payable(msg.sender);
    }

    function withdraw() public {
        // Uncomment this line, and the import of "hardhat/console.sol", to print a log in your terminal
        // console.log("Unlock time is %o and block timestamp is %o", unlockTime, block.timestamp);

        require(block.timestamp >= unlockTime, "You can't withdraw yet");
        require(msg.sender == owner, "You aren't the owner");

        emit Withdrawal(address(this).balance, block.timestamp);

        owner.transfer(address(this).balance);
    }
}

